k_reason': None, 'body': "https://github.com/firebase/firebase-tools/issues/3891 seems to have a root cause in the functions framework.

To reproduce without Firebase:

```
const express = require('express');
const app = express();

app.get('/404', (req, res) => res.send('failed to work'));
app.get('**', (req, res) => res.send('working'));
app.use((err, req, res, next) => res.redirect('/404'));

module.exports.app = app;

if (require.main == module) {
  app.listen(8080);
}
```

If you run the file locally (no functions framework) and `curl http://localhost:8080/%CO` the user is redirected to `http://localhost:8080/404`.

If you deploy the function and CURL the repo (temporarily) at `https://us-central1-inlined-junkdrawer.cloudfunctions.net/param-encoding/%C0`, the functions framework rejects the request before it ever hits customer code with `Bad Request`", 'reactions': {'url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/409/reactions', 'total_count': 1, '+1': 1, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/409/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/comments/1100438140', 'html_url': 'https://github.com/GoogleCloudPlatform/functions-framework-nodejs/issues/409#issuecomment-1100438140', 'issue_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/409', 'id': 1100438140, 'node_id': 'IC_kwDOCrV5Oc5Bl1p8', 'user': {'login': 'grant', 'id': 744973, 'node_id': 'MDQ6VXNlcjc0NDk3Mw==', 'avatar_url': 'https://avatars.githubusercontent.com/u/744973?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/grant', 'html_url': 'https://github.com/grant', 'followers_url': 'https://api.github.com/users/grant/followers', 'following_url': 'https://api.github.com/users/grant/following{/other_user}', 'gists_url': 'https://api.github.com/users/grant/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/grant/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/grant/subscriptions', 'organizations_url': 'https://api.github.com/users/grant/orgs', 'repos_url': 'https://api.github.com/users/grant/repos', 'events_url': 'https://api.github.com/users/grant/events{/privacy}', 'received_events_url': 'https://api.github.com/users/grant/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-04-15T22:11:23Z', 'updated_at': '2022-04-15T22:11:23Z', 'author_association': 'MEMBER', 'body': "To solve this, I think we'd need to support a lifecycle hook to handle `BAD_REQUEST`s to the function.

