{'action': 'opened', 'issue': {'url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework/issues/56', 'repository_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework', 'labels_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework/issues/56/labels{/name}', 'comments_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework/issues/56/comments', 'events_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework/issues/56/events', 'html_url': 'https://github.com/GoogleCloudPlatform/functions-framework/issues/56', 'id': 1205917973, 'node_id': 'I_kwDODCZY3c5H4NkV', 'number': 56, 'title': 'Lifecyle Hooks', 'user': {'login': 'grant', 'id': 744973, 'node_id': 'MDQ6VXNlcjc0NDk3Mw==', 'avatar_url': 'https://avatars.githubusercontent.com/u/744973?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/grant', 'html_url': 'https://github.com/grant', 'followers_url': 'https://api.github.com/users/grant/followers', 'following_url': 'https://api.github.com/users/grant/following{/other_user}', 'gists_url': 'https://api.github.com/users/grant/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/grant/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/grant/subscriptions', 'organizations_url': 'https://api.github.com/users/grant/orgs', 'repos_url': 'https://api.github.com/users/grant/repos', 'events_url': 'https://api.github.com/users/grant/events{/privacy}', 'received_events_url': 'https://api.github.com/users/grant/received_events', 'type': 'User', 'site_admin': False}, 'labels': [], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 0, 'created_at': '2022-04-15T22:10:16Z', 'updated_at': '2022-04-15T22:10:16Z', 'closed_at': None, 'author_association': 'MEMBER', 'active_lock_reason': None, 'body': 'Certain use-cases require function invocations on certain events related to a container's lifecycle or individual function invocation lifecycle.

Here are some possible examples:

- `on('bad_request', (req, res) => {})`
  -  Handle bad HTTP request (400)
- `on('startup', (req, res) => {})`
  - Invoke once after the container is started and before the first HTTP request.
- `on('shutdown', (req, res) => {})`
  - Invoke once before the container is terminated.
- `on('before_function', (req, res) => {})`
  - Invoke before every function invocation
- `on('after_function', (req, res) => {})`
  - Invoke after every function invocation

An example API could be the following:

```js
functionsframework.on('bad_request', (e, req, res, next) {
    if (e.message === "Bad request") {
        res.status(400).json({error: {msg: e.message, stack: e.stack}});
    }
});
```

---

Feel free to add to this issue for your use-case in a comment.', 'reactions': {'url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework/issues/56/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework/issues/56/timeline', 'performed_via_github_app': None}}

