{'action': 'created', 'issue': {'url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/393', 'repository_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs', 'labels_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/393/labels{/name}', 'comments_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/393/comments', 'events_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/393/events', 'html_url': 'https://github.com/GoogleCloudPlatform/functions-framework-nodejs/issues/393', 'id': 1061597412, 'node_id': 'I_kwDOCrV5Oc4_RrDk', 'number': 393, 'title': 'Support for health endpoints in cloudevents functions', 'user': {'login': 'lance', 'id': 15952, 'node_id': 'MDQ6VXNlcjE1OTUy', 'avatar_url': 'https://avatars.githubusercontent.com/u/15952?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/lance', 'html_url': 'https://github.com/lance', 'followers_url': 'https://api.github.com/users/lance/followers', 'following_url': 'https://api.github.com/users/lance/following{/other_user}', 'gists_url': 'https://api.github.com/users/lance/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/lance/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/lance/subscriptions', 'organizations_url': 'https://api.github.com/users/lance/orgs', 'repos_url': 'https://api.github.com/users/lance/repos', 'events_url': 'https://api.github.com/users/lance/events{/privacy}', 'received_events_url': 'https://api.github.com/users/lance/received_events', 'type': 'User', 'site_admin': False}, 'labels': [{'id': 1305455679, 'node_id': 'MDU6TGFiZWwxMzA1NDU1Njc5', 'url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/labels/feature%20request', 'name': 'feature request', 'color': 'f49e13', 'default': False, 'description': ''}], 'state': 'open', 'locked': False, 'assignee': None, 'assignees': [], 'milestone': None, 'comments': 2, 'created_at': '2021-11-23T18:35:46Z', 'updated_at': '2022-03-28T23:41:18Z', 'closed_at': None, 'author_association': 'NONE', 'active_lock_reason': None, 'body': 'When specifying a `Container` object in Kubernetes, it is possible to specify both a `readinessProbe` and a `livenessProbe` which inform the system that the application is healthy. In Knative, these endpoints may also be specified in the `Container` section of a `Service`. However, one thing that Knative does differently is that if not specified, Knative considers "container startup and listening on the declared HTTP socket" sufficient. [[reference](https://github.com/knative/specs/blob/main/specs/serving/runtime-contract.md#meta-requests)].

The implication of this is that Knative is performing a `GET` request to `/` on container startup if these health endpoints are not specified when the `Service` is deployed. Unfortunately, it seems this is explicitly disallowed for cloudevents. https://github.com/GoogleCloudPlatform/functions-framework-nodejs/blob/71eb43fe8e75b6939cce1ec425b84aca4014ed75/src/server.ts#L134-L138 The end result is that I cannot deploy a cloudevents function to Knative because the `Service` never enters the ready state. It would be nice if this framework allowed me to do any one of the following.

* Use it in Knative for cloudevents with predetermined health endpoints
* Use it in Knative for cloudevents with health endpoints that I can configure
* Use it in Knative for cloudevents with support for `GET /`

If it is already possible somehow to do any of the above, can you please provide a doc reference - and my apologies for the oversight. 
', 'reactions': {'url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/393/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'timeline_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/393/timeline', 'performed_via_github_app': None}, 'comment': {'url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/comments/1081256225', 'html_url': 'https://github.com/GoogleCloudPlatform/functions-framework-nodejs/issues/393#issuecomment-1081256225', 'issue_url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/393', 'id': 1081256225, 'node_id': 'IC_kwDOCrV5Oc5Acqkh', 'user': {'login': 'grant', 'id': 744973, 'node_id': 'MDQ6VXNlcjc0NDk3Mw==', 'avatar_url': 'https://avatars.githubusercontent.com/u/744973?v=4', 'gravatar_id': '', 'url': 'https://api.github.com/users/grant', 'html_url': 'https://github.com/grant', 'followers_url': 'https://api.github.com/users/grant/followers', 'following_url': 'https://api.github.com/users/grant/following{/other_user}', 'gists_url': 'https://api.github.com/users/grant/gists{/gist_id}', 'starred_url': 'https://api.github.com/users/grant/starred{/owner}{/repo}', 'subscriptions_url': 'https://api.github.com/users/grant/subscriptions', 'organizations_url': 'https://api.github.com/users/grant/orgs', 'repos_url': 'https://api.github.com/users/grant/repos', 'events_url': 'https://api.github.com/users/grant/events{/privacy}', 'received_events_url': 'https://api.github.com/users/grant/received_events', 'type': 'User', 'site_admin': False}, 'created_at': '2022-03-28T23:41:18Z', 'updated_at': '2022-03-28T23:41:18Z', 'author_association': 'MEMBER', 'body': "Following up here.

Can you give me an exact example of what you want to do?

A HTTP function gives the maximum flexibility for handling different routes, methods, etc. On the other hand, a CE function very specifically handles a POST request to the function. Some languages are restricted by the CESDK receivers, even if we wanted to change our URL handling.

In this case, I'd recommend a function like this...

```js
const functions = require('@google-cloud/functions-framework');

functions.http('myFunc', (req, res) => {
  if (req.method === 'GET') {
    // healthcheck
  } else {
    // handle CloudEvent
  }
});
```

---

We don't handle multiple endpoints in the FFs. We also don't support multiple function handlers or HTTP methods for CloudEvent functions.

If this workaround doesn't satisfy the request, it would help if you stated exactly what code you'd like to deploy and any needed change in the Functions Framework contract: https://github.com/GoogleCloudPlatform/functions-framework", 'reactions': {'url': 'https://api.github.com/repos/GoogleCloudPlatform/functions-framework-nodejs/issues/comments/1081256225/reactions', 'total_count': 0, '+1': 0, '-1': 0, 'laugh': 0, 'hooray': 0, 'confused': 0, 'heart': 0, 'rocket': 0, 'eyes': 0}, 'performed_via_github_app': None}}

