I was attempting to deploy an Node JS (ESM) function to Cloud Functions when I hit a bit of a bug. When the function deploys on GCF  I see the following error in the logs:
` /bin/bash: node_modules/.bin/functions-framework: No such file or directory`

When running the function locally all works as intended.  

Package.json:
```json
{
    "type": "module",
    "name": "test_bot",
    "version": "0.1.0",
    "description": "Test Bot",
    "scripts": {
        "start": "npx functions-framework --target=test_bot"
    },
    "dependencies": {
        "@google-cloud/functions-framework": "^3.0.0",
        "@google-cloud/secret-manager": "^3.10.1"
    },
    "devDependencies": {
        "@google-cloud/functions-framework": "^3.0.0"
    }
}
```

index.js: 
```js
export const test_bot = async (req, res) =>  {
  res.send("Hello World");
};
```

To deploy:
`gcloud beta functions deploy functions_test --region=europe-west1 --trigger-http --runtime=nodejs16`

Things work locally when you run `npm start` but fails when it's on GCF.  Adding --entry-point to the deployment makes no difference. 

